});

router.beforeEach((to, from, next) => {
    if (to.href == '/login') {
        localStorage.removeItem('loginToken');
        localStorage.removeItem('userMenuPermissions');
        next();
        return;
    } else  if (to.href == '/404') {
        next();
        return;
    }

    var isAuthenticated = false;
    var loginService = new LoginService();
    var userMenu = loginService.getUserMenu();
    if (userMenu.length > 0) {
        userMenu.forEach(element => {
            if (element.hasSubMenu) {
                element.items.forEach(element2 => {
                    if (element2.hasSubMenu) {
                        element2.items.forEach(element3 => {
                            if (element3.to == to.href) {
                                isAuthenticated = true;
                            }
                        });
                    } else {
                        if (element.to == to.href) {
                            isAuthenticated = true;
                        }
                    }
                    if (element2.to == to.href) {
                        isAuthenticated = true;
                    }
                });
            } else {
                if (element.to == to.href) {
                    isAuthenticated = true;
                }
            }
        });
    }
    else{
        next('/login');
        return;
    }
    if (isAuthenticated) {
        next();
    } else {
        next('/404');
    }
});

export default router;
